            title:
              'AtensiRakyat.com : Medan - Artawati Ndruru korban dugaan penipuan masuk Polri menangis meminta Kapolda Sumut, Irjen Pol. Whisnu Hermawan Februanto, S.I.K., M.H., menangkap Bharatu Desfiferman Lafau oknum Brimob Mabes Polri yang dilaporkan atas dugaan penipuan dan penggelapan uang Rp.402.500.000.  "Pak Kapolda segera penangkapan terhadap pelaku atas nama Desfiferman Lafau. Aku minta tolong Pak, kasihani kami ini Pak, dia udah menipu kami Pak, kami percaya sama dia karena dia saudara kami. Akhirnya dia enggak bertanggungjawab lagi Pak, tolonglah Pak Kapolri, Bapak Presiden Prabowo dengarkan nasib kami Pak, aku ini masyarakat miskin Pak, tolonglah Pak kasihani dan dengarkanlah Pak," ucap Artawati Ndruru dengan menangis, saat ditemui usai keluar dari Polda Sumut, Selasa (24/06/2025) siang.  Kehadiran Artawati Ndruru bersama Pengacaranya, Neformasi Halawa, SH, C.NSP., C.HMt., dan Dr. Rusmanto Sirait, SH., MH., di Polda Sumut untuk mendampingi para saksi dalam agenda pemberian keterangan.  "Agenda kita hari ini, memenuhi undangan dari Polda Sumut terkait permintaan untuk keterangan saksi daripada korban. Hari ini kita sudah hadirkan dua orang saksi," ucap Neformasi Halawa.  Dikatakan Neformasi Halawa, saksi yang mereka hadirkan adalah saksi yang membenarkan Artawati Ndruru telah mentransfer uang ke Desfiferman Lafau.  "Saksi yang kita hadirkan pada hari ini adalah saksi yang mengetahui langsung tentang transfer uang yang diterima oleh si terlapor (Desfiferman Lafau)," sebutnya.  Laporan mereka di Polda Sumut yang kini telah sampai di tahap pemeriksaan saksi, Neformasi Halawa berharap Polda Sumut segera melakukan upaya paksa atau pun melakukan penahanan terhadap oknum anggota Polri yang diduga dengan sengaja mencoreng nama baik dan citra Kepolisian Republik Indonesia.   "Harapannya, kalau bisa sesegera mungkin oleh Polda Sumut segera memproses laporan kita ini, kalau bisa gelar dan setelah itu tetapkan tersangka dan lakukan proses hukum, kalau bisa ditahan," harap Neformasi Halawa dengan tegas.  Disinggung terkait laporan mereka di Divisi Propam Polri, Neformasi Halawa menyatakan, Desfiferman Lafau mereka laporkan atas penyalahgunaan wewenang dan pelanggaran etik Polri.  "Yang kita laporkan di Divisi Propam Polri satu orang inisial DSF Lafau (Desfiferman Lafau), kalau terkait yang satu (Briptu Febriyanto Situmorang) kita tidak tahu, kita tidak kenal orangnya, tapi mungkin nanti pengembangan dari Kepolisian Polda Sumut atau Mabes Polri," ujarnya.  Sebelumnya, Selasa (20/05/2025) lalu, Bharatu Desfiferman Lafau dan Briptu Febriyanto Situmorang personel Polda Sumut dilaporkan oleh Artawati Ndruru di Polda Sumut setelah merasa tertipu usai mengirimkan uang yang diminta Bharatu Desfiferman Lafau sebesar Rp.402.500.000 sebagai mahar agar LL anak dari Artawati Ndruru dapat masuk Bintara Polri.  Uang Rp.402.500.000 tersebut, Artawati Ndruru mengirimkan ke nomor rekening atas nama Desfiferman Lafau dan Febryanto Situmorang sebanyak 5 tahap pengiriman pada bulan Juni 2024 lalu. #PenipuanMasukPolri  #Penipuan  #Penggelapan  #Polisi  #PoldaSumut  #Propam  #mabespolri  #Prabowo  #Viral  #Medan  #AtensiRakyat ',
